import './Header.css';
const Header = () => {
  const Submit = () =>{
    alert('Thank you');
  }
  var Type = new Typed("#auto",{
    strings:['ijaas','ragz'],
    typeSpeed:100,
    backSpeed:100,
    loop:true,
  })

  
  return (
    <header className="Container">
        <nav className='Navbar'>
            <ul>
                <a href="#"><li>About Us</li></a>
                <a href="#"><li>Contact Us</li></a>
                <a href="#"><li>Services</li></a>
                <a href="#"><li>Payment</li></a>
                <a href="#"><li>Book</li></a>
                <button onClick={Submit}>Order</button>
            </ul>
        </nav>
        <div className='text'>
            <h1>Best <span id="auto"></span></h1>
        </div>
    </header>
  )
}

export default Header;
